window.bookSummaryJSON = "<p><b>The dead wait for Caelan.</b></p> <p>The Goddess of Life has sent Caelan to wake her brother, the Dead God. </p> <p>But crossing the reclusive country of Zastrad is even more treacherous when Caelan and his friends aren’t sure they can trust their guide. </p> <p>The four friends will be tested by violence, death, political intrigue, and secrets better left in the dark. </p> <p>When Caelan finally reaches the fractured godstone, he may have to give up everything to save the family he’s cobbled together.</p> <p><b><i>Wake the Dead</i></b><b> is the third book in the six-book Godstone Saga fantasy series and is not a stand-alone. The story contains danger, secrets, bossy gods, stolen kisses, a new king finding his way, a possessive boyfriend, magic, and lots of delicious angst.</b></p>"; 
